import React from "react";
import "./style.css";

// This file exports the card
const Card = props =>

<div className="card" style={{width: "10rem" }}>
  <img 
  className="card-img-top cardImage" 
  src= {props.thumbnail} 
  alt= {props.thumbnail}
  data-value = {props.id}
  onClick={props.handleButtonClick} 
  />
</div>

export default Card
